 <p>We gladly welcome small groups who wish to serve at Alpha Bitz by: 1) sorting, cleaning, and preparing clothes for display; 2) picking up donations from yard sales or residences (pick-up trucks needed); 3) gathering good-quality furniture and clothing to donate; 4) maintaining grounds; 5) participating in a jail ministry for women; 6) donating skills for repairs and small remodeling projects; 7) using your design and media talents in brochures, flyers, and Web presence; or 8) jail ministry on most Friday afternoons. We will help find the perfect service task for YOU! Ask us about an easy way for your small group to participate in the 400/$21 Hope Partnership.</p>', NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Buffy', ' Russell', NULL, NULL, 'ouralphahouse@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '865-730-6323', NULL, NULL, NULL, NULL, NULL, 'http://ouralphahouse.org', '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-06 16:58:03', '2017-03-06 16:58:03', '4c9361b3-091b-4b86-9396-17d84874a88c'),
 ('56', '62', 'en_us', 'Habitat for Humanity of Knoxville', '<p>When most people think about volunteering for Knoxville Habitat for Humanity the image that comes to mind is one of building houses. Sure, construction is the most visible part of our mission, but we have so many more ways that individuals and groups can give of their time. In whatever capacity they decide to share their talents, our volunteers choose the amount of time they want to give. Some work once a month, some twice a week. It’s up to each individual volunteer. And you don’t have to be experienced to fill any volunteer position. On the construction site, we don’t require any prior knowledge of construction for most volunteer positions. Volunteering with Knoxville Habitat for Humanity is a way to learn new skills, to meet new people, and most importantly, to help a deserving family achieve the dream of home-ownership.</p>', NULL, 'Knoxville', NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Trinity', ' Edgar', NULL, NULL, 'tedgar@khfh.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '865-523-3539', NULL, NULL, NULL, NULL, NULL, 'http://www.knoxvillehabitatforhumanity.com', '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-06 16:58:03', '2017-03-06 16:58:03', 'da44948a-43de-46d4-8128-0c4aa140f697'),
 ('57', '63', 'en_us', 'Meet Our Staff', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, 'We\'d love for you to get to know the people who lead our church on the weekends and throughout the week. We\'re passionate about serving our city and surrounding areas for the glory of God\'s Kingdom.', NULL, '2017-03-10 16:31:29', '2017-03-10 17:13:31', '3de1a8aa-7e91-4c12-b0ac-d8284e0a32c1'),
 ('59', '65', 'en_us', 'Chris Stephens Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:07', '2017-03-10 16:37:08', 'bdc40dba-d0bc-42e1-b34b-81fd0b1c184d'),
 ('60', '66', 'en_us', 'Dr. Chris Stephens', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Chris', 'Stephens', 'Senior Pastor', '<p>Pastor Chris was born in Chattanooga, Tennessee to teen parents who split up when he was only three.</p>\n\n<p>By the age of 22 he was a heavy drug user and dealer. Later that year, Chris woke up in a hospital room after a drug overdose and made a decision to connect with God. This decision was especially amazing since neither Chris nor his family had ever attended church.</p>\n\n<p>Over the next 26 years Chris has been serving God as a speaker and a pastor. He has had the opportunity to speak all over the world and has impacted tens of thousands of lives.</p>\n\n<p>Pastor Chris has written a biographical look at his life and the transformation that took place. The book is called The Climb of Your Life. Chris said if his life could transition from the project to the pulpit; from a life of devastation to an amazing destiny, then so can any life.</p>\n\n<p>As the Senior Pastor of Generic Church Church, he has seen thousands find hope and fulfillment in their destiny. Chris says his purpose is to help people recognize and achieve their full potential. He came so close to death and missing all God had for him he now wants to help others find the same purpose in their lives that he has found.</p>\n\n<p>Pastor\'s blog and information about his book can be found at <a href=\"http://drchrisstephens.com\">DrChrisStephens.com</a>.</p>\n\n<p>You can also connect with Pastor Chris via <a href=\"http://facebook.com/pastorchris\">Facebook</a> and <a href=\"http://twitter.com/drchrisstephens\">Twitter</a>.</p>', 'Pastor@faithpromise.org', '2000', 'pastorchris', 'drchrisstephens', 'drchrisstephens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:09', '2017-03-10 16:41:17', '313b7be7-fe0e-4576-9e73-aa2a521624c9'),
 ('61', '67', 'en_us', 'Randy Riggins', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Randy', 'Riggins', 'High School Pastor', '<p>I have been at FPC since October 2006, and I have been in full time student ministry since 1992.</p>\n\n<p>I enjoy hanging out with my family - wife: Holly, and kids: Shaelee (7), Rylee (5), and Silas (2). I also enjoy running early in the morning (I know, sick huh?) and reading.  Actually, most of my free time gets divided between being an unbelievable husband, watching Rylee annihilate the competition in soccer, attempting to finally beat Shaelee in most any card game, and engaging in deep theological and philosophical debates with Silas.</p>\n\n<p>One unusual thing about me:  In high school, I played a drum major in a chase scene of a made-for-TV movie.</p>\n\n<p>I grew up most of my life in Texas, but I’ve also worked in youth ministry in Oklahoma and Louisiana.</p>\n\n<p>Mexican food is my favorite food group, but a great steak dinner is hard to beat.</p>\n\n<p>I enjoy listening to Passion Worship artists (like Crowder and Tomlin), and students enjoy giving me a hard time about enjoying the music of 80’s artists like Charlie Peacock and Steve Taylor.</p>\n\n<p>I graduated from Baylor University with a BA in Communications, and received my Masters in Religious Education from Southwestern Baptist Theological Seminary.</p>\n\n<p>I am also a partner with Reach Out Youth Solutions in coaching and mentoring youth pastors/workers both nationally and internationally.</p>', 'RandyR@faithpromise.org', '1301', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:09', '2017-03-10 16:41:17', '09072796-6d7e-4fc0-85c1-21ed3d450ad5'),
 ('62', '68', 'en_us', 'Art Jensen', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Art', 'Jensen', 'Pastor of Group Ministries', '<p><strong>How long have you been at Generic Church?</strong><br />I was born and raised in San Diego CA.  I am married and have four Children; two boys and two girls.  Before moving to Tennessee I spent four years in Denver.</p>\n\n<p><strong>When did you come on staff?</strong><br />I have been on staff at Generic Church since June of ’07.</p>\n\n<p><strong>What’s your favorite hobby?</strong><br />I love sports. My favorite to watch is pro football.  My favorite team is the San Diego Chargers.  And my favorite sport to play is surfing; although the surf in Tennessee is not that great, I will keep trying.</p>\n\n<p><strong>What is something unusual about you?</strong><br />I have a twin brother…</p>\n\n<p><strong>If you could be any animal, what would it be?</strong><br />If I could be any animal, I would be hmmmm… human.  Okay, how about a sheep?  That way I could spend all day with the “Shepherd”. Okay, okay… I would be an eagle, I think it would be cool to be able to fly.</p>\n\n<p><strong>Your favorite food, least favorite food, greatest fear, most embarrassing moment, or nickname growing up.</strong><br />My favorite food is probably steak and potatoes, but I also really like Mexican food, come to think of it, I really like food. My least favorite is shellfish. I am allergic.  My most embarrassing moment is now writing this bio.\n… And my nickname growing up,… you will have to ask my wife,… and she\'d better not tell you.</p>', 'ArtJ@faithpromise.org', '1401', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:09', '2017-03-10 16:41:17', 'b9166cc8-cd8a-489f-a750-fd9f1f347680'),
 ('64', '70', 'en_us', 'Gloria Petrowski Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:10', '2017-03-10 16:37:11', '7e010223-5bb1-4d32-a95a-23467b64e672'),
 ('65', '71', 'en_us', 'Gloria Petrowski', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Gloria', 'Petrowski', 'Assistant to the Senior Pastor', '<p>I was born in Oak Ridge and have never lived anywhere else. I was raised in a loving Christian home and was saved and baptized at the age of nine. I have one younger sister, Lisa, who lives in Snellville, GA. My parents are both deceased.</p>\n\n<p>I have been married to my awesome husband, Larry, for 36 years. God blessed us with two wonderful children - Justin, 27 and Jenna, 24 - and their equally wonderful spouses - Kara, 26 and Ben, 25. We all serve the Lord here together in various ways in the Worship Ministry of Generic Church. I began singing in the Cherub Choir at the age of three and have been singing since that time!</p>\n\n<p>I was the first employee hired here when Generic Church began in 1995. I worked first in finance and membership and then became Pastor Chris\' personal assistant when he joined us in 1996. What a joy it is to serve alongside him and to see all the many miracles God continues to perform here!</p>\n\n<p>I enjoy walking, boating, reading, and especially traveling. If someone says \"go\", I am always ready! I love hot chocolate-chip cookies and don\'t like greens! I don\'t like heights, but through the years I have learned to conquer that fear somewhat. My nickname growing up was Glory or Gloworm and I can speak pig-Latin really fast!</p>', 'GloriaP@faithpromise.org', '2000', 'gloria.petrowski', 'gfpetrowski', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:11', '2017-03-10 16:41:17', 'd01ffa93-33c9-475d-9978-ebf34656a956'),
 ('67', '73', 'en_us', 'Marti Willen Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:12', '2017-03-10 16:37:13', 'fe7a0d8f-6262-4ff2-bd93-33032cc45c19'),
 ('68', '74', 'en_us', 'Marti Willen', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Marti', 'Willen', 'First Impressions & Facilities Director', '<p>I came on staff in 2007, and I absolutely love working at FPC! I have a fantastic life, thanks to my awesome husband, Tim, and our boys, Jacob and Caleb. I love hanging out with my family, reading, singing, and most of all, I love laughing. FP has given me more opportunities than I could have ever dreamed of, and I am so grateful that God led me to a place where He is constantly moving.</p>', 'MartiW@faithpromise.org', '1703', NULL, 'mwillen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:14', '2017-03-10 16:41:17', '2b4db2b8-e356-4a0f-a0a3-3216d40f4cff'),
 ('69', '75', 'en_us', 'Jayne Bass', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Jayne', 'Bass', 'Children\'s Services Coordinator', NULL, 'JayneB@faithpromise.org', '1402', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:14', '2017-03-10 16:41:17', 'ed436d9f-ac3f-4291-b24b-2a09a5e2bec3'),
 ('71', '77', 'en_us', 'Michele Stephens Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:15', '2017-03-10 16:37:16', '9f16d745-1ac8-46d5-ae23-843daba19198'),
 ('72', '78', 'en_us', 'Michele Stephens', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Michele', 'Stephens', 'Global Worship & Creative Arts Pastor', '<p>My name is Michele but I often answer to \"Shay\", \"Coach\", \"Mich\" and \"Mom\". These names come from relationships with my husband, co-workers, team members and my children.</p>\n\n<p>I have been married to my best friend, Chris (who happens to be the Sr. Pastor), for 25 years, and we have 3 awesome children Faith, Micah, and Zac as well as a brand new son-in-law, Frankie.</p>\n\n<p><strong>When I Met Jesus:</strong> I grew up in a godly home where my parents taught me how to study and memorize God?s word, share my faith, and most of all, worship. I began my relationship with Jesus at the age of 8 years old, and what a ride it has been!</p>\n\n<p><strong>My Calling:</strong> As far as a calling to be a worship leader ? that one kind of snuck up on me. I had grown up in a musical home where both of my parents lead in worship through singing and playing the guitar. My dad would make me play the piano and sing (at the time I hated it ? I was scared to death!) in church, during mission trips, or anywhere else he could find. After all those experiences, I guess I should have seen what was coming down the pike.</p>\n\n<p>I met my sweetheart at what was then called the BSU at UT-Chattanooga. He was going to be a preacher ? me a preacher?s wife?! But now I know that God had prepared me my whole life to be Chris? helpmate and ministry partner. I loved working in different areas as we began our ministry, but it seemed no matter what ministry it was, worship was at the heart.</p>\n\n<p>As the ministry assistant to the Worship Pastor at Generic Church Church, they asked me to fill in when he left until they could find someone. Well, that was almost 9 years ago. God has confirmed to me over and over that He called me and put me where I am today ? I would have never believed it, and there is no way I could do what I do without the anointing and favor of the Lord.</p>\n\n<p><strong>Favorite Music:</strong> Anything Hillsong, anything Chris Tomlin, and ?clean? classic rock. (I am an ?80s girl.)</p>\n\n<p><strong>Hobbies:</strong> Anything with my family, scrapbooking, and photography.</p>', 'MicheleS@faithpromise.org', '1501', 'michele7317', 'michele7317', 'michele7317', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:17', '2017-03-10 16:41:18', '7484c28f-af33-424d-bf40-32d1ec4ba004'),
 ('73', '79', 'en_us', 'Caroline Ervin', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Caroline', 'Ervin', 'Membership Director', '<p>Caroline Ervin has been on staff as the Membership Director since September 2006.</p>\n\n<p>She attended Samford University in Birmingham, Alabama, and graduated with a bachelor’s degree in Journalism and Mass Communication.  Caroline met her husband, Brad Ervin (who is also on staff at FPC), in college, and they were married in 2003.</p>\n\n<p>Caroline enjoys traveling and going on mission trips to China and Africa.  She also loves to read, shop, and spend time with her small group.</p>\n\n<p>Her biggest annoyance is when people ask her when she and Brad are going to start having kids.</p>', 'CarolineE@faithpromise.org', '1001', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:17', '2017-03-10 16:41:18', 'ca01ff35-e052-46d3-9c24-535d495b54b3'),
 ('74', '80', 'en_us', 'Nancy Bachor', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Nancy', 'Bachor', 'Assistant to the Membership Director', '<p>My husband David and I started attending Generic Church in October 2004. I came on staff in early 2007, and I am so humbled that God allows me to be even the tiniest part of what He is doing here at FPC!!</p>\n\n<p>In 1998 David, our two sons Sean and Ryan, and I set out from south Florida to our Promised Land, with hurricane Georges traveling along beside us.  Our little family of four that moved to East Tennessee has grown in the ten years that we have been here.  We have added to our family a lovely daughter-in-law, Christy, and two precious grandchildren, Colin and Audrey. We are blessed more than we could hope or imagine!!</p>\n\n<p>I love to spend time with my family, especially the grandkids, truly a gift from God!!  I have been classified by my husband as not just a book lover but a book collector.  I love to read - especially anything that draws me closer to the Lord. I also enjoy Sudoku, hiking, camping, geocaching, target practice, and riding the motorcycle with my hubby.</p>\n\n<p>My favorite food? It might be easier to list what I don’t like... sushi, rhubarb, and liver.  Everything else is my favorite especially anything Italian, Mexican, Asian, Mediterranean, Cajun, or American.</p>\n\n<p>Unusual? Well, I would have to say “yes, I am” but that’s not what you meant.  I want the truth, no matter how painful just give it to me straight, no fluff and please, please, do not beat around the bush!!! Oh yeah, and check out the left pinky toe when I’m wearing flip-flops or barefoot.</p>\n\n<p>Facebook at Nancy Bachor</p>', 'NancyB@faithpromise.org', '1013', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:17', '2017-03-10 16:41:18', 'f26ad692-6481-440c-8554-6328505850c5'),
 ('76', '82', 'en_us', 'Aaron Goin Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:18', '2017-03-10 16:37:19', '4de557f0-0204-47f6-8a62-e5e7735b62fe'),
 ('77', '83', 'en_us', 'Aaron Goin', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Aaron', 'Goin', 'Chief Financial Officer', '<p>Aaron Goin joined the staff of Generic Church as Finance Director in August 2007, and in January 2011, Aaron took on the role of Chief Financial Officer. In this role he gets to work alongside great teams in Finance, Human Resources, Information Technology, Communications, Next Steps, and Facilities.</p>\n\n<p>Aaron and his wife Kerri were married in 2000. Their daughter Gracie was born in April 2006 and their son Mason was born in August of 2009. They love all things Disney, Dollywood, the beach, and any other kind of family adventure.</p>\n\n<p>In 2002, Aaron graduated from the University of Tennessee with a bachelor\'s degree in Finance. He received his Master of Business Administration degree in December 2010. Before joining the staff of Generic Church, he worked for five years at Oak Ridge National Laboratory as a Subcontract Administrator.</p>\n\n<p>\"It has been an amazing journey to watch Generic Church grow and to play a small part in that growth. Can\'t wait to see what God does as we continue to reach the world for Him.\"</p>', 'AaronG@faithpromise.org', '1602', NULL, 'aarongoin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:19', '2017-03-10 16:41:18', 'aaa891b4-2956-4464-a39c-d899f5391a29'),
 ('78', '84', 'en_us', 'Robin Floyd', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Robin', 'Floyd', 'Assistant to the Financial Director', '<p>My family has attended Generic Church, off and on, since they began meeting in the old church in Oak Ridge.  We served in other churches in between but kept returning to FPC and have been here since 2006.   I began working at Generic Church in April ’08.</p>\n\n<p>I love to read and spend time with my family.  I have 2 daughters. Chelsea is 14 and Lauren is 11, and their schedules take up most of my time outside work.  I have been married for 15 years to my husband, Greg.</p>\n\n<p>I homeschooled both of my children until last year.</p>\n\n<p>Any food is my favorite, except chicken livers, and I have a HUGE fear of heights.</p>', 'rfloyd@faithpromise.org', '1600', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'cd5f132f-f926-43dd-8da2-c7bc64dfc244'),
 ('79', '85', 'en_us', 'Chris Cox', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Chris', 'Cox', 'Facilities Director', '<p>Amy and I started attending Generic Church in 2004. We were married January 2005, and we have two children, Lexie and Brayden. I\'ve been on staff since January 2007.</p>\n\n<p><strong>Random Facts:</strong> I grew up in Oliver Springs, TN, and I was a junior olympic in white water kayaking.  I like to fish, play golf, and spend time with my family.  I will eat just about any kind of food, but my favorite is lasagna. My wife can whip me at Guitar Hero. Some people may not know this, but I almost pass out whenever I see blood.</p>', 'ChrisC@faithpromise.org', '1703', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', '94e8a1d6-2195-4f8e-8886-55de15f9ac1c'),
 ('80', '86', 'en_us', 'Adrianne Adams', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Adrianne', 'Adams', 'Housekeeper', NULL, 'AdrianneA@faithpromise.org', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'c39563c4-9034-4bac-8b8c-33421bc4ddd3'),
 ('81', '87', 'en_us', 'Adam McCue', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Adam', 'McCue', 'Worship Associate', '<p>Hey everyone… I’m Adam!</p>\n\n<p>I have been part of Generic Church Church since early 2000. Started volunteering Day 1 (somewhat under my own volition). Serving is BIG here, and it’s a blast!</p>\n\n<p>I volunteered in Worship for a long time.  That\'s where I learned to play some music… enough to make me dangerous, anyway.  After seven years or so, when they realized I wouldn’t leave, I was brought on staff. Somewhere in there (2006), I graduated from UTK with a Finance/Economics degree, which I use everyday.  Hahaha.</p>\n\n<p>Hobbies…? Uhhhhh… I like to play golf, soccer, and most other sports. I love to snow ski! I enjoy going to restaurants with my fiancé, Mary Beth Rader, and hanging out with her in general.</p>\n\n<p>Unusual…? well, I was a competitive power tumbler during the high school years. We went all over the south-east to meets and competitions and stuff… super fun!</p>\n\n<p>Hit me up on Facebook, or find me after a service and introduce yourself, I LOVE that!!!</p>', 'AdamM@faithpromise.org', '1505', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'a1e7f616-fca2-4817-a5fd-97c975e2991e'),
 ('82', '88', 'en_us', 'Mia Hannahs', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Mia', 'Hannahs', 'Blount Campus fpKids Director', '<p>Mia joined the FPC staff in August of 2005, after meeting Pastor Chris at Ripley’s Believe It or Not in Gatlinburg. She has a passion for early childhood education and has been working with preschoolers and their families for twenty years.</p>\n\n<p>She grew up in a big family that enjoyed music and art and is the last of seven kids. Now, she is the mother to Parker [an aspiring artist], Tyler [a self-proclaimed sci-fi fanatic] and Kylie [who loves horseback riding].</p>\n\n<p>She enjoys singing, reading, camping, and creating. Her greatest hope-  helping multitudes of families and volunteers develop a strong spiritual foundation in young children. Her greatest fear- being trapped in a car underwater.</p>', 'MiaH@faithpromise.org', '1200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'ae3e4c1b-0ce2-4b15-b6b1-c469d0978c67'),
 ('83', '89', 'en_us', 'Pam Bakker', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Pam', 'Bakker', 'Assistant to the PromiseKids Director', '<p>Pam has been at Generic Church since June 2001 and came on staff December 2007.  Her favorite hobbies include cooking and reading.</p>\n\n<p>Her favorite food is Mexican or pasta, least favorite is veggies, and greatest fear is not making a difference for Jesus.</p>\n\n<p><strong>Something unusual about yourself?</strong><br /> I grew up inn Southern California, and I am the mother of twins, born by surrogacy (my sister).</p>\n\n<p><strong>If you could be any animal, what would it be?</strong><br />A bird.  I\'d love to travel around and see everything!</p>', 'PamB@faithpromise.org', '1201', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'b0481943-da0d-45d0-97d6-a23d9b9c13fe'),
 ('84', '90', 'en_us', 'Jennifer Loveday', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Jennifer', 'Loveday', 'KidK\'nex Programming Director', '<p>Among her other attributes, Jennifer is a fan of people (all shapes, sizes, ages, and backgrounds).  After five years on staff at Generic Church, she currently works with people of the smaller variety in our K-5th grade Children’s Ministry (KidK’nex) program.  Originally from Knoxville, Jennifer returned home after several treks in professional theaters, tours, and ministries.  She holds a degree in Communication and Theater Arts from the University of the Cumberlands.  As KidK’nex Programming Director, she incorporates her love for Christ, children and creative storytelling each weekend into a Large Group teaching environment.  She enjoys smiles,  laughter, energy, fun, insight, and sincerity from all our wonderful Generic Church kids.</p>', 'JenniferL@faithpromise.org', '1102', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'b9c4ccc1-eb69-4472-aa3e-3e0143a73aa8'),
 ('85', '91', 'en_us', 'Susan Troop', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Susan', 'Troop', 'Kid’s Hope Coordinator ', '<p>Susan Troop has been on staff part time since October of 2006.  She served as the Mother’s Day Out Director prior to taking the position of Kids Hope USA Director.</p>\n\n<p>She attended the University of Vermont, where she earned her bachelor’s degree in Elementary Education.  She has ten years of teaching experience.</p>\n\n<p>Susan met her husband and was married in Orlando, FL in 1993.  While growing up in Vermont, she has also lived in Florida, Kansas, and Virginia before settling in Knoxville.</p>\n\n<p>Susan is the mother of three girls and two dogs.  She enjoys shopping, naps, and special times with the family.  She also enjoys going on mission trips and has especially loved traveling to South Africa.</p>', 'SusanT@faithpromise.org', '1202', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'd7182735-c0cc-44b2-8bc6-2686a90fcfed'),
 ('86', '92', 'en_us', 'Caitie Maylott', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Caitie', 'Maylott', 'Caitie Maylott', NULL, 'CaitieM@faithpromise.org', '1203', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', '121bc928-c573-416d-b218-9fccb207c322'),
 ('87', '93', 'en_us', 'Cheryl Christensen', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Cheryl', 'Christensen', 'Administrative Support Assistant', '<p>Cheryl and her family have been at Generic Church since 2003, and she came on staff in January 2008.</p>\n\n<p><strong>Favorite Hobbies:</strong><br /> I like to travel, hang out with my boyfriend of 25 years, go to the movies, and do girl things with my daughters!</p>\n\n<p><strong>Something Unusual:</strong><br /> My husband was in the Navy for 20 years, and I was the command liaison for the submarine, USS Tennessee, for 4 years.</p>\n\n<p><strong>If you could be any animal, what would it be?</strong><br /> I would be a dog! They give unconditional love, and they get to eat, sleep, and play all day.</p>\n\n<p><strong>Life Calling:</strong><br /> I love missions, and Greg and I intend to go into full time missions one day. Every trip I\'ve ever been on has been great! I have been to Thailand 2 times, Macau, and Capetown.</p>', 'CherylC@faithpromise.org', '1000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', 'dcc68e3d-bdef-472b-b3aa-c5ffb68e78e4'),
 ('88', '94', 'en_us', 'Teresa Merritt', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Teresa', 'Merritt', 'Assistant to the High School Pastor', '<p>Teresa is a Knoxville native with a BS degree from UT. She has three grown children (a son and two married daughters). She and her husband, Mark, have been members at Generic Church Church since 2005. Teresa is passionate about young people finding their God-designed purpose in life and living the abundant life that Jesus promises those who seek Him with their whole heart.</p>\n\n<p><strong>HOBBY:</strong> READING</p>\n\n<p><strong>UNUSUAL:</strong> I love microbiology &amp; biochemistry</p>\n\n<p><strong>ANIMAL:</strong> A fat, lazy cat (one that could read, preferably)</p>\n\n<p><strong>FAVORITE FOOD:</strong> Vanilla ice cream (not because it’s boring but because of all the ways it can be changed!)</p>', 'TeresaM@faithpromise.org', '1300', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:20', '2017-03-10 16:41:18', '2bf8ea49-f11a-4820-87c9-b11967228126'),
 ('90', '96', 'en_us', 'Matt Grimes Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:21', '2017-03-10 16:37:22', '96de61ae-09b2-4573-8fdc-ec6e460f4609'),
 ('91', '97', 'en_us', 'Matt Grimes', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Matt', 'Grimes', 'Blount Campus Pastor', '<p>Matt grew up in Alabama and went to college at Samford University in Birmingham, where he graduated with a degree in religious studies. He also holds a Master\'s degree in Christian Education from New Orleans Seminary. Matt has served in student ministry at Generic Church Church since 2005 where he established and built the middle school ministry before taking over all students in 2013.</p>\n\n<p>In addition to his work at Generic Church and his time traveling and speaking at conferences and events, Matt also serves on staff with Ken Davis and Michael Hyatt as a Communication Coach for Dynamic Communicators International.</p>\n\n<p>Matt is married to Carmen, and they have a beautiful daughter, Elin who was born in 2011.</p>', 'MattG@faithpromise.org', '1706', 'matt.grimes.7', 'mattgrimes', 'themattgrimes', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:23', '2017-03-10 16:41:18', 'dc41a139-2fbd-4f0a-a9fc-7ea402416024'),
 ('93', '99', 'en_us', 'Brad Ervin Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:23', '2017-03-10 16:37:24', '8420b69b-f1af-4a40-9824-5cd1dfa01243'),
 ('94', '100', 'en_us', 'Brad Ervin', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Brad', 'Ervin', 'Pastor of Outreach and Missions', '<p>Brad Ervin is the Pastor of Outreach and Missions at Generic Church. He joined the staff in Nov 2007, and he and his wife Caroline have been attending Generic Church since February of 2006. Brad is a huge Vol fan and loves sports in general. He graduated with a BS in Business Marketing from Samford University in 2001.</p>\n\n<p>Hobbies include: reading (Tolkien/Ayn Rand/Robert Jordan some favs), travel, music (especially British Rock), movies, broadway and west end musicals, and sucking the marrow out of life. He is also an accomplished break dancer and pole vaulter.</p>\n\n<p>Facebook him Brad Ervin, twitter: BradErvin and myspace: Volcrazy.</p>', 'BradE@faithpromise.org', '1405', 'bradervin', 'bradervin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:25', '2017-03-10 16:41:18', '1aaf9a19-e9e1-4c02-830c-b2adc338c8d8'),
 ('96', '102', 'en_us', 'Jaclyn Holloway Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:26', '2017-03-10 16:37:27', '0d59eaad-cfd8-4ec2-9d8f-8215a7bd48f8'),
 ('97', '103', 'en_us', 'Jaclyn Holloway', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Jaclyn', 'Holloway', 'fpCreative Project Manager', '<p>A beach girl at heart that fell in love with the mountains, Jaclyn moved to Knoxville from Virginia Beach in 2005. Jaclyn has a B.S. in Communications from the University of Tennessee with a focus on video production. She has been a part of the worship ministry staff since 2011 and feels extremely blessed to be part of such a talented and creative team. She enjoys film producing and acting as part of her ministry, especially when humor is involved.</p>\n\n<p>When she goes home, she gets to play her favorite role: a wife and mother. Her husband, Phil Holloway is also on staff in the worship ministry as the Vocal Director. They are blessed with two very active boys, Jameson and Jude. Favorite family hobbies include dance parties with Yo Gabba Gabba, drag racing hot wheels, and extreme water balloon fights. Follow their adventures on twitter: @HollowayJaclyn, snapchat: jhollaback, Instagram: jholloway1120</p>', 'JaclynH@faithpromise.org', '1503', NULL, 'HollowayJaclyn', 'jholloway1120', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:27', '2017-03-10 16:41:18', '88487354-5521-4534-82e9-5c0d420e2431'),
 ('98', '104', 'en_us', 'Debbie McChesney', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Debbie', 'McChesney', 'Worship Assistant', '<p>On November 18th, 1999, during her freshman year of college at the University of the Cumberlands, Debbie surrendered her heart and life to Christ. In 2004, she married the love of her life, Adam, and they began attending Generic Church in 2005.</p>\n\n<p>Both Debbie and Adam serve in the worship ministry, and Debbie joined the worship staff in November of 2007. She is the proud mother of a beautiful little girl, Abigail, and enjoys karaoke, scrapbooking, and spending time with her family.</p>', 'DebbieM@faithpromise.org', '1503', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:27', '2017-03-10 16:41:18', 'fceb7e21-e583-45ba-8558-8280177a9e9f'),
 ('99', '105', 'en_us', 'Nolan Smith', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Nolan', 'Smith', 'Worship Technical Director', NULL, 'nolan@faithpromise.org', '1504', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:28', '2017-03-10 16:41:18', 'd8a9e3ec-eb20-4923-830a-8411f7167c20'),
 ('101', '107', 'en_us', 'Kyle Gilbert Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:28', '2017-03-10 16:37:29', '71c12b03-0ad7-41a4-95b8-96204783f47c'),
 ('102', '108', 'en_us', 'Kyle Gilbert', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Kyle', 'Gilbert', 'Pastor of Communications & Internet Campus Pastor', '<p>Kyle came on staff at Generic Church Church in October 2008 as the Pastor of Communications. He oversees web technology, graphic design, the Internet Campus, and helping get the word out about our church.</p>\n\n<p>He and his wife, Keri, were married in 1999 and haven\'t owned a TV since then. They have four crazy-awesome kids, including a set of twins.</p>\n\n<p>Kyle has gone skydiving, and he once went scuba diving in the Black Sea after five minutes of instruction (in Russian).</p>\n\n<p>For fun, Kyle loves to play disc golf and racquetball, and he plays both poorly but with enthusiasm.</p>\n\n<p>You can keep up with Kyle on his blog at <a href=\"http://kylesrandom.com\">KylesRandom.com</a> or <a href=\"http://twitter.com/kylegilbert\">follow him on Twitter</a>.</p>', 'KyleG@faithpromise.org', '1704', 'kylegilbert', 'kylegilbert', 'kylegilbert', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:30', '2017-03-10 16:41:18', '012d954a-82e3-40ca-880f-aaf9dd44abd1'),
 ('103', '109', 'en_us', 'Drew Wells', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Drew', 'Wells', 'Pastor of Young Adults', '<p>Drew has attended Generic Church since 1996.  He started on staff as an intern for the Student Ministry and eventually came on full-time in 2003 as the Student Ministry Program Director.  In December of 2007, he became the Pastor of Young Adults.</p>\n\n<p>Drew married his beautiful bride Sandy in 2005, graduated college from Tusculum College with an AS in General Sciences in 2003 and from Tusculum College with BS in Organizational Management in 2006.</p>\n\n<p>Drew is an associate blogger for Titan Sized, a Tennessee Titans Fan Blog. He also enjoys using his vacation days to sit front row at LP Field or Wrigley Field to watch his beloved Titans and Cubs.</p>\n\n<p>The Star Wars hexology are the best 6 movies ever… by humans.</p>\n\n<p>Hip-hop is vastly superior to all other genres and forms of music.</p>\n\n<p>Facebook at Young Adults.fpc or Twitter at dreWells</p>', 'DrewW@faithpromise.org', '1011', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:30', '2017-03-10 16:41:19', '497e6ea9-2211-4c16-af5b-76488740630b'),
 ('105', '111', 'en_us', 'Sid Spiva Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:31', '2017-03-10 16:37:32', '22c70210-6a8f-45c7-bcaf-5a3f9579547d'),
 ('106', '112', 'en_us', 'Sid Spiva', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Sid', 'Spiva', 'Multisite Facilities Director', '<p>Sid is a lifelong resident of Clinton and Anderson County. After working in Anderson County Schools for 32 years as a High School Teacher and Principal, Sid entered full time ministry in 2008. He joined the Generic Church staff when the Anderson County Campus opened in 2013.</p>\n\n<p>Sid and his wife Judy of 40 years have two outstanding sons, two wonderful daughter-in-laws, and two awesome grandsons.</p>\n\n<p>He enjoys traveling, riding motorcycles, music, and spending time with family.</p>', 'SidS@faithpromise.org', NULL, 'sid.spiva', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:32', '2017-03-10 16:41:19', 'f4d2a70d-8db7-4c6d-acfd-1ff29d62b45d'),
 ('108', '114', 'en_us', 'Emily Carringer Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:33', '2017-03-10 16:37:34', 'af119ece-210b-4ecb-a8f2-811da721c0e9'),
 ('109', '115', 'en_us', 'Emily Carringer', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Emily', 'Carringer', 'Production Pastor', '<p>My husband, Chuck, and I have been at Generic Church Church since the very first service at the Garden Plaza Hotel in Oak Ridge. However, I didn\'t join the FPC staff until 2003.</p>\n\n<p>It has been an adventure ever since. You really never know what each day will hold. We have two great kids that have grown up at FPC. Zach is 14 and Maggie is 11. When we\'re not at church, we love eating out and hanging out together as a family.</p>\n\n<p>I love to read, have fun, and laugh a lot, usually at myself. One of the coolest parts about what I get to do is to help others be a part of the Worship Ministry and serve where they are passionate.</p>', 'EmilyC@faithpromise.org', '1500', 'emily.carringer', 'emilycarringer', 'emilycarringer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:35', '2017-03-10 16:41:19', '4bd033d2-bbd2-4449-9a25-706c8d846916'),
 ('111', '117', 'en_us', 'Jennifer Patrick Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:36', '2017-03-10 16:37:36', 'c00a332d-3961-4897-8444-d00792f1aead'),
 ('112', '118', 'en_us', 'Jennifer Patrick', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Jennifer', 'Patrick', 'Group Assimilation Coordinator', '<p>Jennifer has been attending Generic Church Church since January 2002. Soon afterwards, she and her family attended a small group, and that began her love for small group ministry. She started out as a volunteer in small group ministry, and she\'s been on staff since 2005.</p>\n\n<p>In her free time, she and her husband, Rob love to spend time at the lake with friends and family and make frequent visits to the Smoky mountains.</p>', 'JenniferP@faithpromise.org', '1403', 'jennifer.c.patrick.94', NULL, 'jenniferlpatrick', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:37', '2017-03-10 16:41:19', '61050ef9-c4e2-4a2e-b23a-4d6837b320da'),
 ('114', '120', 'en_us', 'Heather Burson Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:38', '2017-03-10 16:37:39', '75eb0dec-275d-4ffb-8098-096906d05536'),
 ('115', '121', 'en_us', 'Heather Burson', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Heather', 'Burson', 'Graphic Designer', '<p>Hi, I\'m Heather. I\'m a native East Tennessean, graduate of the University of Tennessee, and a die-hard Vols fan. My husband, Mike, and I enjoy travel, college football, and a little friendly competition now and again.</p>\n\n<p>On staff since 2007, I love being a member of the Communications Team (part of the Admin staff) and a keeper of the Generic Church brand. One of my favorite things about designing at Generic Church is the variety of projects that come my way, but by far the best thing is that is I get to be part of an awesome team that is impacting the world for Christ.</p>', 'HeatherB@faithpromise.org', '1014', 'heatherburson', 'heatherburson', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:39', '2017-03-10 16:41:19', '425f4de9-6a2c-4abe-a3a4-70fa3c322c09'),
 ('116', '122', 'en_us', 'Evan Crass', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Evan', 'Crass', 'Associate Pastor of Groups', '<p>Evan serves as a pastor in the groups office at Generic Church Church. Although Evan rolled on staff in July 2008, he has been a part of FPC since the very beginning. Prior to becoming a staff member, he served in various areas, including the Leadership Team and the Management Team and has continuously served as a group leader since returning home for graduate school in 1998.</p>\n\n<p>Evan’s background includes working with start-ups and emerging companies, and he continues to consult with these companies, specifically in the areas of operations and finance. It is this same passion to see new companies grow that drives him to create and nurture new and creative groups to connect people with God and others.  These groups form the foundation for the church’s diverse offering of interest groups.</p>\n\n<p>He and his wife, Marta, were married in May 2000. They have a daughter, Kate, who was added to the family in May 2007, and a son, Andrew, who was born in December 2009. The extended family includes the hundreds of people who have been a part of their group over the years.</p>\n\n<p>You can connect with Evan on <a href=\"http://www.facebook.com/evancrass\" target=\"_blank\" rel=\"noreferrer\">Facebook</a> or on <a href=\"http://twitter.com/evancrass\" target=\"_blank\" rel=\"noreferrer\">Twitter</a>.</p>', 'EvanC@faithpromise.org', '1404', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '4cd2f1ab-75b3-4422-85ba-b5e03d6d2af5'),
 ('117', '123', 'en_us', 'Phil Bledsoe', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Phil', 'Bledsoe', 'Technical Director', '<p><strong>About Me:</strong> I was born in Tallahassee, Florida, and was raised in Georgia - mostly around the Atlanta area. My family was a very strong Christian family and all of us were involved in the church from an early age.</p>\n\n<p>I moved to Nashville in 1998 to pursue a degree in Music Business and Recording. I was in a band but transitioned to the production side of things when I moved to Nashville. Originally, I was focused on a future in studio work, but God continually gave me more opportunities in live production.  I began working for artists with whom I had played in my performing days and those jobs quickly opened more opportunities deeper into the Christian Music Industry. I spent a few years in audio, a few years in lighting and transitioned back to Audio with the added responsibility of tour managing for bands such as Skillet and Tree63. For the past 7 years I\'ve taken off in the fall to production manage a 15-20 band traveling music festival called SHOUTfest, showcasing many major industry headliners such as Third Day and Newsboys.</p>\n\n<p>I was married in 2002 to my beautiful bride, Shanell. She is originally from the Knoxville area but we met at MTSU in 2000. We travelled together for years until she launched a successful photography business in 2007. My decision to leave the glamour of the road is based around our great desire to start a family. We\'ve been blessed with the opportunity to join the FP family and are looking forward to growing our family internally and externally!</p>\n\n<p><strong>Interesting Fact:</strong> Shanell and I took a two-month honeymoon and travelled the entire US and Canada (including Hawaii).</p>', 'PhilB@faithpromise.org', '1510', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '83d85ace-6945-4510-b757-f51434274aa1'),
 ('118', '124', 'en_us', 'Krista McBroom', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Krista', 'McBroom', 'Receptionist', '<p>Krista has attended Generic Church since May 2007.  She first came on staff as a summer intern for the student ministry and has been on staff since January 2008.</p>\n\n<p>She attended Carson Newman College where she got her degree in Child and Family Studies.  She has also started working on her Masters in Christian Education.</p>\n\n<p>She likes to read, scrapbook, and be outside.  But her favorite thing to do is writing poetry and devotionals.</p>\n\n<p>Something unusual about her is that she is left handed.</p>', 'krista@faithpromise.org', '1000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '3ad44579-6d7f-4070-9ba7-4bc113833edb'),
 ('119', '125', 'en_us', 'Justin Truluck', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Justin', 'Truluck', 'Live Production Director', '<p>Born in Farragut, I was raised as a second generation Christian and was brought up in and around the church in all elements of life. At the age of 13, with no understanding of how things worked, I was put behind a sound board to fill a need for the church I was serving in and have never looked back.</p>\n\n<p>In 2004 I graduated from Farragut High school and joined the staff at M&amp;L Sound where my passion and understanding for all things audio continued to grow.</p>\n\n<p>During my final years in grade school, I decided that I needed to experience the world in a new and truly unique way, so I opted to study abroad and continue developing my understanding of God and his plan. I did this by attending Southern Cross College in Sydney Australia where I graduated in 2008 with a Bachelors of Theology in Christian Ministry. During that time I continued to serve God through my involvement in a church production department and had the opportunity to be involved in many large-scale events which continued to build my understanding of all aspects of Production.</p>\n\n<p>Today I am continuing to grow personally and corporately and I can\'t wait to see what God has in store for the future.</p>', 'JustinT@faithpromise.org', '1515', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '77d2e489-1c13-4780-99ba-b6cc630affc8'),
 ('120', '126', 'en_us', 'Tanya Tumminello', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Tanya', 'Tumminello', 'KidK’nex Ministry Assistant', NULL, 'TanyaT@faithpromise.org', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '47762be6-fc1f-4fbe-bada-7319daf32cd7'),
 ('121', '127', 'en_us', 'Matt James', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Matt', 'James', 'Video Director', '<p>I am a Geek. Now, a lot of people associate geekdom with those guys in High School who had absolutely zero people skills. Those are nerds. Geeks are the hybrids who get along and enjoy the company of people as well as the company of technology. Therefore, I am a Geek.</p>\n\n<p>I\'m overly educated with a BS degree in Television Production from MTSU (Go Chicken Horses! err... Raiders!) as well as surviving a five-year apprenticeship in the IBEW. So, I\'m either an Electrician who dabbles in Video Production or a Video Producer who dabbles in Electrical work.</p>\n\n<p>Hobbies include reading, home improvement, four wheeling in my Jeep, Movies, Music, as well as a select few TV shows. Reading is usually something Science Fiction flavored. I\'ve also branched spiritual growth books since I became a Christian. Favorite books include Dune, Blue like Jazz, and Velvet Elvis. I also have a weakness for Stephen King’s writing.</p>\n\n<p>My taste in movies is all over the map - from classics such as ‘Metropolis’ to more modern works like ‘Coraline’. Musical tastes are also all over the map... From Rock, to Classical, to Bluegrass - I\'ll listen to anything. TV shows such as Lost, Eli Stone, NCIS, Good Eats, and Battlestar Galactica (the new one) are among those set to record on my DVR.</p>\n\n<p>I\'ve been a member of Generic Church since 2002 when I accepted Jesus as my Lord and Savior. Shortly after that, I started volunteering in the Video Ministry. Since then, I\'ve I joined the staff as Video Director. In what I hope is an indicator of things to come, my first three days on staff were snow days.</p>\n\n<p>If you want, look me up on Facebook or just send me an email. I\'m always up for email, something about being a geek....</p>\n\n<p>Or, check out my blog: <a href=\"http://realtater.blogspot.com\">realtater.blogspot.com</a>.</p>', 'MattJ@faithpromise.org', '1520', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:40', '2017-03-10 16:41:19', '5b1f1cae-48d6-4136-bceb-7c6ad4a44bc2'),
 ('123', '129', 'en_us', 'Zac Stephens Square', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-10 16:37:41', '2017-03-10 16:37:42', '989e24b2-ea9a-4e25-972b-e809ceb03ff1');



